The testimony provided by Nichody states that he hid the victim's body in the spare Pegabull lantern after tearing a page out of Sorin's notebook. However, evidence indicates that the lantern, in which the victim's body was found, had a bloodstain on the inside wheel handle. This raises questions about how Nichody was able to hide a body in the lantern if there was already blood present, which could suggest prior tampering or a different timeline of events.

The contradiction lies in the fact that Nichody claims to have hidden the body in the lantern, yet the presence of the bloodstain implies that the lantern was involved in a struggle or had been used in a different context prior to him hiding the body.

