The evidence that contradicts the testimony is the "White Cat Photograph #2 → Pawnbroker's Ticket (Coat)" (Evidence 4), which shows a bloody fingermark identified as Mr Mason's, suggesting a violent encounter involving him at the scene of the crime. This contradicts Nash Skulkin's testimony (Testimony 3) where he claims they only broke into the place as instructed and implies they were not involved in anything violent other than the break-in. 

Thus, the contradiction lies in the implication of violence and the presence of blood linking Mr Mason to the scene versus Nash's claim of a lesser crime.

